import FreeBoardLists from "./components/FreeBoard/FreeBoardLists";
import Header from "./components/Header";

const App = (props) => {
  return (
    <>
      <div className="init-view">
        <Header />
        <FreeBoardLists></FreeBoardLists>
      </div>
    </>
  );
};

export default App;
